__NUXT_JSONP__("/svet/mesto/el-tarter", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t){return {data:[{place:[{id:g,id_state:h,name:m,population:1132,area:6.2,altitude:1710,slug:n,information_chatgpt:"\u003Cp\u003EEl Tarter je malé horské městečko v Andoře, které se nachází v blízkosti lyžařského areálu Grandvalira. Je to oblíbené místo pro lyžaře, kteří sem přijíždějí ze všech koutů Evropy.\u003C\u002Fp\u003E\n\u003Cp\u003ELyžařský areál Grandvalira, který se nachází v blízkosti El Tarteru, je největším lyžařským areálem v Andoře a celém Pyrenejském pohoří. Nabízí 210 kilometrů sjezdovek různých obtížností, 118 vleků a moderní infrastrukturu pro zajištění komfortu lyžařů.\u003C\u002Fp\u003E\n\u003Cp\u003ENavzdory své popularitě mezi lyžaři a snowboardisty, El Tarter je také ideálním místem pro ty, kteří hledají klidnou dovolenou v krásné přírodě. V létě můžete podniknout mnoho pěších túr v okolí a užít si krásné výhledy na Pyreneje. Existuje řada turistických tras, které vedou přes horské louky a lesy a nabízejí úžasnou příležitost pro objevování divoké krásy Andorry.\u003C\u002Fp\u003E\n\u003Cp\u003EEl Tarter nabízí také řadu restaurací a kaváren, kde si můžete vychutnat místní kuchyni a nápoje s výhledem na krásné okolní hory. Pokud máte rádi nakupování, můžete navštívit místní trhy, kde se prodávají tradiční andorrské produkty, jako jsou sýry, klobásy a víno.\u003C\u002Fp\u003E\n\u003Cp\u003EZajímavým místem k návštěvě v El Tarteru je kaple sv. Klementa, která se nachází na konci městečka. Kaple byla postavena v 18. století a nabízí krásný výhled na okolní krajinu. Také stojí za to navštívit malou vesnici Soldeu, která se nachází v blízkosti El Tarteru a je známá pro své tradiční architektonické prvky.\u003C\u002Fp\u003E\n\u003Cp\u003EEl Tarter je ideálním místem pro lyžaře a turisty, kteří hledají klidnou dovolenou v krásné horské krajině. Je to skvělé místo pro relaxaci a užívání si přírody, stejně jako pro aktivní dovolenou v zimě i v létě.\u003C\u002Fp\u003E",coordinates:[{latitude:42.5793,longitude:1.6537}],biggest:b,type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:o,value:p}],alerts:a,zoom:[{google:g,booking:q}]}],imagePlace:a,placeState:[{id:h,tld:".ad",name:"Andorra",area:468,population:77006,slug:r,id_continent:f,information_chatgpt:"\u003Cp\u003EAndorra je malý stát v Evropě, nacházející se v Pyrenejích mezi Francií a Španělskem. S rozlohou pouhých 468 km² a s populací kolem 77 tisíc obyvatel je to jedna z nejmenších zemí na kontinentě. Hlavním městem je Andorra la Vella.\u003C\u002Fp\u003E\n\u003Cp\u003EAndorra je známá především jako daňový ráj, což znamená, že mnoho zahraničních firem a bohatých lidí sem přesouvá své peníze, aby se vyhnuli vysokým daním v jejich zemi původu. Nicméně, Andorra také nabízí návštěvníkům krásné horské krajiny s množstvím turistických tras a lyžařských středisek. Kromě toho, můžete zde navštívit také mnoho historických památek, jako např. románské kostely a středověké hrady.\u003C\u002Fp\u003E\n\u003Cp\u003EZemě má také svou vlastní kuchyni, která se skládá z mnoha tradičních jídel. Mezi nejznámější patří \"trinxat\", což je směs vařených brambor a zelí s bůčkem, a \"escudella\", což je silná polévka s masem a zeleninou. Můžete si také vychutnat národní nápoj - \"cim de neu\", což je lihovina z ovoce a bylin.\u003C\u002Fp\u003E\n\u003Cp\u003EAndorra není členem Evropské unie, ale v roce 1993 se stala členem Organizace spojených národů. Má vlastní měnu - andorrský frank, ale euro je také všeobecně přijímáno. Pokud se chystáte na návštěvu Andorry, nezapomeňte si přinést platný cestovní pas nebo průkaz totožnosti, protože i když se jedná o malou zemi, stále je to suverénní stát s vlastními předpisy a zákony.\u003C\u002Fp\u003E",currency_code:"EUR",currency_name:"euro",money_prices:[{name:"Taxi (cena za km)",value:j,date_update:d},{name:"Hlavní jídlo",value:15,date_update:d},{name:"Chleba",value:.9,date_update:d},{name:"Mléko",value:.8,date_update:d},{name:"Voda (500ml)",value:.7,date_update:d},{name:"Espresso",value:j,date_update:d},{name:"Zmrzlina (jeden kopeček)",value:s,date_update:d},{name:"Pivo",value:2.5,date_update:d},{name:"Krabička cigaret",value:4.8,date_update:d},{name:"Bic Mac",value:4.5,date_update:d},{name:"Coca Cola (500ml)",value:j,date_update:d}],phone_numbers_emergency:[{name:"Policie",value:"110",date_update:k},{name:"Hasiči",value:"118",date_update:k},{name:"Zdravotnická záchranná služba",value:"116",date_update:k}],phone_prefix:"+376",coordinates:[{latitude:"42.546245",longitude:"1.601554"}],people_religion:[{name:"Římskokatolická církev",value:"88.2%"},{name:"Protestantství",value:"2.3%"},{name:"Bez vyznání",value:"6.8%"},{name:"Jiná náboženství",value:"2.7%"}],people_nationality:a,visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Andorry stačí občanský průkaz, pokud jste občanem zemí Evropské unie a Schengenského prostoru.",date_update:e},{name:"Cestovní pas",value:"Cestovní pas není nutný pro vstup do Andorry, pokud jste občanem zemí Evropské unie a Schengenského prostoru. Pokud nejste občanem EU nebo Schengenského prostoru, budete potřebovat platný cestovní pas.",date_update:e},{name:"Vízum",value:"Pro občany zemí Evropské unie a Schengenského prostoru není potřeba víza pro pobyt v Andoře. Pokud nejste občanem EU nebo Schengenského prostoru, může být pro vstup do Andorry vyžadováno vízum. Podrobnosti a požadavky na vízum závisí na vaší zemi původu.",date_update:e},{name:"Očkování",value:"Pro vstup do Andorry nejsou vyžadována žádná specifická očkování.",date_update:e},{name:"Cestovní pojištění",value:"Pro vstup do Andorry není vyžadováno žádné zvláštní cestovní nebo zdravotní pojištění, ale doporučuje se, abyste měli platné cestovní pojištění, které pokrývá lékařské náklady a úrazové pojištění.",date_update:e},{name:"Bezpečnostní situace",value:"Andorra je bezpečnou zemí s nízkou mírou kriminality. Nicméně jako v jakékoli jiné zemi, turisté by měli dodržovat obecná opatření, například střežit si cennosti a vyhýbat se nebezpečným oblastem v noci.",date_update:e},{name:"Další informace",value:"Andorra je malá země s horským klimatem, takže je dobré být připraven na různé klimatické podmínky a přinést s sebou vhodné oblečení. V Andoře se mluví katalánsky, španělsky a francouzsky, ale angličtina se také často používá. Kromě zimních sportů nabízí Andorra také vynikající turistické stezky a lázeňské služby.",date_update:e}],type_place:t,id_image_cover:i,id_image_hero:i,id_city_main:h,affiliate:[{name:o,value:p}],mpz:"AD",alerts:a,zoom:[{google:g,booking:q}],ids_neighboring_countries:[{id:75},{id:68}]}],imageState:[{id:i,name:r,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-04-10T23:51:03.795051+00:00",type:t,author:"pixabay.com"}],placeContinent:[{id:f,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003EEvropa je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV Evropě se nachází mnoho zajímavých měst. Například Paříž, Londýn, Řím, Barcelona, Praha, Berlín a Amsterdam jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása Evropy je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. Alpské hory nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba Plitvická jezera v Chorvatsku, Krkonošský národní park v České republice nebo Národní park Durmitor v Černé Hoře, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n\u003Cp\u003EPři návštěvě Evropy si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří italská, francouzská a španělská. Italská kuchyně je známá svými těstovinami, pizzou a zmrzlinou. Francouzská kuchyně nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. Španělská kuchyně je známá svými tapas, paellou a sangriou. Kromě těchto kuchyní jsou v Evropě také velmi oblíbené pokrmy jako německé klobásy, anglické snídaně, holandský sýr a mnoho dalšího.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:l,booking:l}]}],placesCities:[{id:h,id_image_cover:a,slug:"andorra-la-vella",type_place:c,name:"Andorra la Vella",biggest:b},{id:9,id_image_cover:a,slug:"arinsal",type_place:c,name:"Arinsal",biggest:b},{id:6,id_image_cover:a,slug:"canillo",type_place:c,name:"Canillo",biggest:b},{id:g,id_image_cover:a,slug:n,type_place:c,name:m,biggest:b},{id:f,id_image_cover:a,slug:"encamp",type_place:c,name:"Encamp",biggest:b},{id:s,id_image_cover:a,slug:"escaldes-engordany",type_place:c,name:"Escaldes-Engordany",biggest:b},{id:5,id_image_cover:a,slug:"la-massana",type_place:c,name:"La Massana",biggest:b},{id:i,id_image_cover:a,slug:"les-escaldes",type_place:c,name:"Les Escaldes",biggest:b},{id:7,id_image_cover:a,slug:"ordino",type_place:c,name:"Ordino",biggest:b},{id:l,id_image_cover:a,slug:"sant-julia-de-loria",type_place:c,name:"Sant Julia de Loria",biggest:b}],imagesCities:a,videos:[],imagesVideos:a,posts:[],imagesPosts:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:void 0}}(null,"yes","city","07-2021","09-2021",4,10,1,8,1.5,"05-2023",3,"El Tarter","el-tarter","booking",true,11,"andorra",2,"state")));